fetch logs, samplingRatio: 1000
| fieldsAdd  status = coalesce(
    if(status == "NONE", record(status="🟪 NONE", ord=3)),
    if(status == "INFO", record(status="🟦 INFO", ord=2)),
    if(status == "WARN", record(status="🟧 WARN", ord=1)),
    if(status == "ERROR",record(status="🟥 ERROR",ord=0)))
| sort status[ord] asc
| fieldsAdd status = status[status]

